import { ImageComponent } from 'components';
import React from 'react';
import { ImagesPreview, ImageContainer } from './styled';
const Component = ({ images, setMainImg }) => {

    const loadImages = images.map((image, index) => <ImageContainer onMouseOver={() => setMainImg(image)} key={`image-${index}`} onClick={() => setMainImg(image)}><ImageComponent src={image} /></ImageContainer>)
    return (
        <ImagesPreview>
            <ImageComponent>
                {loadImages}
            </ImageComponent>
        </ImagesPreview>

    );
}

export default Component;
